import React, { useContext, useState, useEffect } from "react";
import { Box, Typography, Card, CardContent, CardActions, Button, Grid, TextField } from "@mui/material";
import DashboardLayout from "../components/DashboardLayout";
import { UserContext } from "../contexts/UserContext";
import axios from "axios";

export default function TrainerDashboard() {
  const { currentUser } = useContext(UserContext);
  const [workshops, setWorkshops] = useState([]);
  const [activeView, setActiveView] = useState("list"); // "list" or "create"
  const [newWorkshop, setNewWorkshop] = useState({
    title: "",
    description: "",
    trainer_id: currentUser?.id || 1,
  });

  // Fetch workshops from API
  useEffect(() => {
    axios.get("http://127.0.0.1:8001/workshops/")
      .then((res) => setWorkshops(res.data))
      .catch((err) => console.error("Error fetching workshops:", err));
  }, []);

  // Handle workshop creation
  const handleCreateWorkshop = () => {
    axios.post("http://127.0.0.1:8001/workshops/", {
      ...newWorkshop,
      sections: [] // empty sections initially
    })
      .then((res) => {
        setWorkshops((prev) => [...prev, res.data]);
        setActiveView("list");
        setNewWorkshop({ title: "", description: "", trainer_id: currentUser?.id || 1 });
      })
      .catch((err) => console.error("Error creating workshop:", err));
  };

  const menuItems = [
    { label: "My Workshops", path: "#", action: () => setActiveView("list") },
    { label: "Create Workshop", path: "#", action: () => setActiveView("create") },
  ];

  return (
    <DashboardLayout menuItems={menuItems}>
      {activeView === "list" ? (
        <>
          <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center", mb: 3 }}>
            <Typography variant="h4" fontWeight="bold" color="primary">
              My Workshops
            </Typography>
          </Box>

          {workshops.length === 0 ? (
            <Typography variant="body1" color="text.secondary">
              You have not created any workshops yet.
            </Typography>
          ) : (
            <Grid container spacing={3}>
              {workshops.map((workshop) => (
                <Grid item xs={12} sm={6} md={4} key={workshop.id}>
                  <Card elevation={3} sx={{ borderRadius: 2 }}>
                    <CardContent>
                      <Typography variant="h6" fontWeight="bold">
                        {workshop.title}
                      </Typography>
                      <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
                        Sections: {workshop.sections?.length || 0}
                      </Typography>
                    </CardContent>
                    <CardActions sx={{ justifyContent: "flex-end" }}>
                      <Button size="small">View</Button>
                      <Button size="small">Edit</Button>
                    </CardActions>
                  </Card>
                </Grid>
              ))}
            </Grid>
          )}
        </>
      ) : (
        <>
          <Typography variant="h4" fontWeight="bold" color="primary" gutterBottom>
            Create Workshop
          </Typography>
          <Box sx={{ display: "flex", flexDirection: "column", maxWidth: 400, gap: 2 }}>
            <TextField
              label="Title"
              value={newWorkshop.title}
              onChange={(e) => setNewWorkshop({ ...newWorkshop, title: e.target.value })}
            />
            <TextField
              label="Description"
              multiline
              rows={3}
              value={newWorkshop.description}
              onChange={(e) => setNewWorkshop({ ...newWorkshop, description: e.target.value })}
            />
            <Button variant="contained" color="primary" onClick={handleCreateWorkshop}>
              Save Workshop
            </Button>
            <Button variant="text" color="secondary" onClick={() => setActiveView("list")}>
              Cancel
            </Button>
          </Box>
        </>
      )}
    </DashboardLayout>
  );
}
